Saves the model instance using the configured proxy.  The save action
is asynchronous.  Any processing of the saved record should be done in a callback.

Create example:

    Ext.define('MyApp.model.User', {
        extend: 'Ext.data.Model',
        fields: [
            {name: 'id', type: 'int'},
            {name: 'name', type: 'string'}
        ],
        proxy: {
            type: 'ajax',
            url: 'server.url'
        }
    });

    var user = new MyApp.model.User({
        name: 'Foo'
    });

    // pass the phantom record data to the server to be saved
    user.save({
        failure: function(record, operation) {
            // do something if the save failed
        },
        success: function(record, operation) {
            // do something if the save succeeded
        },
        callback: function(record, operation, success) {
            // do something whether the save succeeded or failed
        }
    });

The response from a create operation should include the ID for the newly created
record:

    // sample response
    {
        success: true,
        id: 1
    }

    // the id may be nested if the proxy's reader has a rootProperty config
    Ext.define('MyApp.model.User', {
        extend: 'Ext.data.Model',
        proxy: {
            type: 'ajax',
            url: 'server.url',
            reader: {
                type: 'ajax',
                rootProperty: 'data'
            }
        }
    });

    // sample nested response
    {
        success: true,
        data: {
            id: 1
        }
    }

(Create + ) Update example:

    Ext.define('MyApp.model.User', {
        extend: 'Ext.data.Model',
        fields: [
            {name: 'id', type: 'int'},
            {name: 'name', type: 'string'}
        ],
        proxy: {
            type: 'ajax',
            url: 'server.url'
        }
    });

    var user = new MyApp.model.User({
        name: 'Foo'
    });
    user.save({
        success: function(record, operation) {
            record.set('name', 'Bar');
            // updates the remote record via the proxy
            record.save();
        }
    });

(Create + ) Destroy example - see also <a href='#!/api/Ext.data.TreeModel-erase'>erase</a>:

    Ext.define('MyApp.model.User', {
        extend: 'Ext.data.Model',
        fields: [
            {name: 'id', type: 'int'},
            {name: 'name', type: 'string'}
        ],
        proxy: {
            type: 'ajax',
            url: 'server.url'
        }
    });

    var user = new MyApp.model.User({
        name: 'Foo'
    });
    user.save({
        success: function(record, operation) {
            record.drop();
            // destroys the remote record via the proxy
            record.save();
        }
    });

**NOTE:** If a <a href='#!/api/Ext.data.TreeModel-phantom'>phantom</a> record is <a href='#!/api/Ext.data.TreeModel-drop'>dropped</a> and subsequently
saved it will not be processed via the proxy.  However, any passed `success`
or `callback` functions will be called.

The options param is an Operation config object containing success, failure and
callback functions, plus optional scope.  The type of Operation depends on the
state of the model being saved.

 - <a href='#!/api/Ext.data.TreeModel-phantom'>phantom</a> model - <a href='#!/api/Ext.data.operation.Create'>Ext.data.operation.Create</a>
 - <a href='#!/api/Ext.data.TreeModel-isModified'>modified</a> model - <a href='#!/api/Ext.data.operation.Update'>Ext.data.operation.Update</a>
 - <a href='#!/api/Ext.data.TreeModel-dropped'>dropped</a> model - <a href='#!/api/Ext.data.operation.Destroy'>Ext.data.operation.Destroy</a>

